import Portfolio from './Components/Portfolio';

class App extends Component {
  state = {
    todos:[
      {
        id:1,
        title: 'create resume'
      },
      {
        id:2,
        title: 'finish intern'
      }

    ]
  }
  render() {
    return (
      <div className="App">
        <Header todos={this.state.todos}></Header>
      </div>
    );
  }
}

export default App;
